import React, { Component } from 'react';
import './assets/section.css';
import project1 from './assets/images/project1.png';

class Projects extends Component{
    render(){
        return(
            <div className = "section-bg">
                <div className = "container text-center">
                    <h2 style = {{ display : "inline-block" }}>My <strong>Projects</strong></h2>
                    <div className = "row row-cols-3">
                        
                        <div className = "col-md-4">
                            <div className = "card">
                                <img src = { project1 } alt = "NodeJs project"/>
                                <div className = "card-body">
                                    <h4>Blog API using NodeJS,MongoDB and Express</h4>
                                    <p className = "lead">
                                        This is a simple Blog page i made using NodeJS, MongoDB and Express. This has a login and register page and after login you have an editor where you can upload your blog and you can even edit and delete those blogs!
                                    </p>
                                </div>
                            </div>
                        </div>
                        <div className = "col-md-4">

                        </div>
                        <div className = "col-md-4">

                        </div>
                        
                        
                    </div>
                </div>
            </div>
        );
    }
}

export default Projects;
